CrÃ©ation du projet
Pour crÃ©er des API, Laravel est un peu Â« lourd Â» (dans notre cas bien Ã©videmment, dans certains cas te choix est complÃ¨tement justifiÃ©). Nous allons donc utiliser son petit frÃ¨re Lumen. Lumen est un micro-framework reprenant les concepts de Laravel (et les mÃªme briques), mais en beaucoup plus petit et donc plus adaptÃ© Ã  des micro-projets comme celui-ci.
Installer Lumen
Lâ€™installation de Lumen est similaire Ã  celle de Laravel
composer global require "laravel/lumen-installer"

CrÃ©er le nouveau Projet
Maintenant que vous avez installÃ© Lumen nous allons pouvoir utiliser la ligne de commande pour crÃ©er un nouveau projet :
lumen new api-todo

âœ‹ Attention, le projet va Ãªtre crÃ©Ã© dans le dossier api-todo dans le dossier courant.
Initialisation
Contrairement Ã  un projet Laravel, les dÃ©pendances composer ne sont pas installÃ©es par dÃ©faut. Il faut donc les installer via la ligne de commande en faisant :
