Sous Windows la commande touch n'existe pas. Il faut crÃ©er un fichier vide (sans retour Ã  la ligne) dans votre IDE / Ã©diteur de texte.
Câ€™est parti ! Tout est prÃªt, nous pouvons commencer Ã  Ã©crire du code.
Le script de crÃ©ation / migration
Contrairement Ã  la premiÃ¨re version de notre application, nous allons stocker les donnÃ©es dans une base de donnÃ©es. Qui dit base de donnÃ©es dit Â« ORM Â» et donc mapping objet. Pour rappel un ORM :

Un mapping objet-relationnel (en anglais object-relational mapping ou ORM) est une technique de programmation informatique qui crÃ©e l'illusion d'une base de donnÃ©es orientÃ©e objet Ã  partir d'une base de donnÃ©es relationnelle en dÃ©finissant des correspondances entre cette base de donnÃ©es et les objets du langage utilisÃ©.

Pour rappel, le but de notre application est de crÃ©er des API Rest qui vont exposer la gestion de nos todos dÃ©fini en base de donnÃ©es. La premiÃ¨re Ã©tape est de crÃ©er via la ligne de commande le Â« script Â» qui initialisera la structure de votre base de donnÃ©es.
Lâ€™option --create=todos permet dâ€™indiquer le nom de la table Ã  crÃ©er
php artisan make:migration create_todos_table --create=todos

âœ‹ Le contenu du fichier est fictif, il est la pour illustrer comment travailler. Nous allons le modifier pour mettre les informations relative Ã  notre base de donnÃ©es.
La commande a crÃ©Ã© un nouveau fichier (dans mon cas) : database/migration/2017_11_02_205700_create_todos_table.php
Dans le fichier crÃ©Ã© nous allons dÃ©finir notre schÃ©ma (Ã  savoir la dÃ©finition de la table) pour ajouter les 2 colonnes qui nous serons utiles texte et termine. Le fichier aprÃ¨s modification doit ressembler Ã  :
increments('id');
            $table->string('texte');
            $table->boolean('termine');
            $table->timestamps();
        });
    }

    /**
     * Reverse the migrations.
     *
     * @return void
