Suppression
Pour la partie suppression, nous allons devoir dans un premier temps rÃ©cupÃ©rer la todo par son ID. Seul les Todos marquÃ©s comme terminÃ©s peuvent Ãªtre supprimÃ©, il faudra donc controller lâ€™Ã©tat avant de faire le delete()
public function deleteTodo($id){
        $todo  = Todos::find($id);
