DÃ©clarer les routes
Maintenant que le mapping avec la base de donnÃ©es est crÃ©Ã©, et que notre controller est disponible nous allons pouvoir dÃ©clarer les diffÃ©rentes Â« routes Â» (câ€™est Ã  dire les chemins dâ€™accÃ¨s Ã  votre API). Dans notre applicaton nous avons 4 routes :

