Nous allons Â« mapper Â» / Â« connecter Â» les routes avec les diffÃ©rentes actions de notre controller. Avec un framework câ€™est trÃ¨s simple il suffit dâ€™ajouter dans le fichier routes/web.php le code suivant :
$router->get('api/todo','TodosController@list');
